import React, { Component } from 'react'

export class Home extends Component {
  render() {
    return (
      <div style={{backgroundImage: 'http://www.crowneplazaphx.com/resourcefiles/smallimages/location-of-phoenix-arizona-hotel-sm.jpg'}}>
        Home
      </div>
    )
  }
}

export default Home
